import { Button, Stack } from '@mui/material';

const options = [
  {
    title: 'Employee Infomation',
  },
  {
    title: 'Contract Information',
  },
  {
    title: 'Employment Details',
  },
  {
    title: 'Salary & Wages',
  },
  {
    title: 'Others',
  },
];

function Option() {
  return (
    <Stack spacing={2} direction="row">
      {options.map((text, index) => (
        <Button
          key={index}
          variant="contained"
          sx={{
            textTransform: 'none',
            padding: '8px 22px',
            backgroundColor: 'rgba(193, 200, 205, 0.24)',
            minWidth: '78px',
            height: '48px',
            fontWeight: '400',
            fontFamily: 'SVN-Sofia-Regular',
            fontSize: '14px',
          }}
        >
          {text.title}
        </Button>
      ))}
    </Stack>
  );
}

export default Option;
